import React, { useState } from 'react';

import MenuIcon from '@mui/icons-material/Menu';
import CloseIcon from '@mui/icons-material/Close';
import Logo from '../../assets/logo/logo.png';
import NavLinks from './Navlinks';

function Navbar() {
	const [open, setOpen] = useState(false);
	return (
		<>
			<nav className="bg-primary md:text-textColor text-textBlack fixed w-full">
				<div className="container mx-auto flex items-center font-medium justify-between">
					<div className="z-50 p-5 md:w-auto w-full flex justify-between">
						<img src={Logo} alt="logo" className="md:cursor-pointer h-10" />
						<div className="text-3xl md:hidden" onClick={() => setOpen(!open)}>
							{open ? <CloseIcon className="text-textColor" /> : <MenuIcon className="text-textColor" />}
						</div>
					</div>
					<ul className="md:flex hidden items-center gap-3 font-[Poppins]">
						<NavLinks />
					</ul>

					{/* Mobile nav */}
					<ul
						className={`
        md:hidden bg-white fixed w-full top-0 overflow-y-auto bottom-0 py-24 pl-4
        duration-500 ${open ? 'left-0' : 'left-[-100%]'}
        `}
					>
						<NavLinks />
					</ul>
				</div>
			</nav>
		</>
	);
}

export default Navbar;
